def removeDuplicates( nums):
        """
        :type nums: List[int]
        :rtype: int
        """
        
        i = 0
        ct = 1
        while i < len(nums)-1:
            if nums[i] != nums[i+1]:
                ct += 1
            i += 1
        return ct
