def strStr(haystack, needle):
        """
        :type haystack: str
        :type needle: str
        :rtype: int
        """
        flag = {}
        if needle == "":
            return 0
        else:
            for i in range(len(haystack)):
                if haystack[i] == needle[0]:
                    flag[i] = True
                    # print i
                    if len(needle) > len(haystack) - i:
                        flag[i] = False
                    for j in range(len(needle)):
                        flag[i] = flag[i] and haystack[i+j] == needle[j]
            if True in flag.values():
                mini = float('inf')
                for k in flag:
                    if flag[k]:
                        mini = min(k,mini)
                return mini
                
            else:
                return -1
