def frequencySort(s):
        """
        :type s: str
        :rtype: str
        """
        d = {}
        for i in s:
            d[i] = 0
        for j in s:
            d[j] += 1
        a = d.values()
        a.sort()
        res = ''
        # print d
        for k in a:
            for k2 in d:
                if d[k2] == k and k2 not in res:
                    for dd in range(k):
                        res += k2

        return res
                
