def trailingZeroes( n):
        """
        :type n: int
        :rtype: int
        """
        res = fact(n)
        res = str(res)
        ct = 0
        for j in range(len(res)-1,-1,-1):
            if res[j] == '0':
                ct += 1
            else:
                break
        return ct
def fact(n):
    if n <= 1:
        return 1
    else:
        return n*fact(n-1)
print(trailingZeroes(120))
